DROP TABLE IF EXISTS `orders`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `orders` (
  `order_id` int NOT NULL AUTO_INCREMENT,
  `public_order_code` varchar(50) NOT NULL,
  `customer_name` varchar(100) NOT NULL,
  `customer_email` varchar(255) NOT NULL,
  `customer_phone` varchar(50) NOT NULL,
  `price_total` decimal(10,2) DEFAULT NULL,
  `order_status` enum('AwaitingManualQuote','Quoted','Paid','Completed','Cancelled') NOT NULL,
  `note` text,
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `office_location` varchar(100) DEFAULT NULL,
  `first_contact` int DEFAULT NULL,
  `current_person` int DEFAULT NULL,
  `previous_person` int DEFAULT NULL,
  PRIMARY KEY (`order_id`),
  UNIQUE KEY `public_order_code` (`public_order_code`),
  UNIQUE KEY `uk_orders_public_order_code` (`public_order_code`),
  KEY `ix_orders_status_created` (`order_status`,`created_at`),
  KEY `ix_orders_customer` (`customer_name`,`customer_email`),
  KEY `fk_orders_first_contact` (`first_contact`),
  KEY `fk_orders_current_person` (`current_person`),
  KEY `fk_orders_previous_person` (`previous_person`),
  KEY `ix_orders_created_at` (`created_at`),
  CONSTRAINT `fk_orders_current_person` FOREIGN KEY (`current_person`) REFERENCES `users` (`user_id`) ON DELETE RESTRICT ON UPDATE CASCADE,
  CONSTRAINT `fk_orders_first_contact` FOREIGN KEY (`first_contact`) REFERENCES `users` (`user_id`) ON DELETE RESTRICT ON UPDATE CASCADE,
  CONSTRAINT `fk_orders_previous_person` FOREIGN KEY (`previous_person`) REFERENCES `users` (`user_id`) ON DELETE RESTRICT ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=649 DEFAULT CHARSET=utf8mb3;
/*!40101 SET character_set_client = @saved_cs_client */;

