DROP TABLE IF EXISTS `timesheet_signatures`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `timesheet_signatures` (
  `signature_id` bigint NOT NULL AUTO_INCREMENT,
  `timesheet_id` int NOT NULL,
  `signer_role` enum('employee','manager') NOT NULL,
  `signed_by_user_id` int DEFAULT NULL,
  `signed_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `signature_mime_type` varchar(50) NOT NULL DEFAULT 'image/png',
  `signature_blob` longblob NOT NULL,
  `signature_sha256` char(64) DEFAULT NULL,
  PRIMARY KEY (`signature_id`),
  UNIQUE KEY `uk_timesheet_role` (`timesheet_id`,`signer_role`),
  KEY `ix_sig_timesheet` (`timesheet_id`),
  KEY `ix_sig_signed_by` (`signed_by_user_id`),
  CONSTRAINT `fk_sig_timesheet` FOREIGN KEY (`timesheet_id`) REFERENCES `timesheets` (`timesheet_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_sig_user` FOREIGN KEY (`signed_by_user_id`) REFERENCES `users` (`user_id`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=40 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
